def detect_vertex_movements(first, second):
    # Invert the mappings: vertex -> class
    vertex_to_class_first = {v: c for c, vs in first.items() for v in vs}
    vertex_to_class_second = {v: c for c, vs in second.items() for v in vs}

    movements = []
    for vertex, original_class in vertex_to_class_first.items():
        new_class = vertex_to_class_second.get(vertex)
        if new_class is not None and new_class != original_class:
            movements.append(f"vertex {vertex} moved to colour_class {new_class} from {original_class}")

    return movements


